package net.scr0pt.crawl.school

import com.mongodb.client.MongoClients
import com.mongodb.client.MongoCollection
import net.scr0pt.thirdservice.mongodb.MongoConnection
import net.scr0pt.utils.webdriver.DriverManager
import org.bson.Document
import org.bson.conversions.Bson
import org.openqa.selenium.By


fun main() {
    val mongoClient = MongoClients.create(MongoConnection.eduConnection)
    val serviceAccountDatabase = mongoClient.getDatabase("edu-school-account")
    val collection: MongoCollection<Document> = serviceAccountDatabase.getCollection("diploma-neu-2")

    val firefox =DriverManager(driverType = DriverManager.BrowserType.Firefox)
    firefox.get("http://vanbang.neu.edu.vn/#mainResult")
    firefox.clickFirstEl(By.id("ctl00_phd_slices_VanBangListViewOnly__searchButton"))
    Thread.sleep(500)
    while (true) {
        firefox.doc?.let { parserResult(it, collection) }
        firefox.clickFirstEl(".rgPageNext")
        Thread.sleep(500)
    }
}


fun parserResult(
        doc: org.jsoup.nodes.Document,
        collection: MongoCollection<Document>
) {
    val headers = arrayListOf<String>()
    doc.select("table.rgMasterTable  th.header-text.rgHeader")?.forEach {
        val title = it.text()
        if (title != "Chức năng") {
            headers.add(title)
        }
    }

    doc.select(".rgDataDiv .rgMasterTable tbody  tr")?.forEach { tr ->
        val values = arrayListOf<String>()
        val doc = Document()
        tr?.select("td.item")?.forEach {
            values.add(it.text())
        }

        if (values.isNotEmpty()) {
            for (i in 0 until headers.size) {
                try {
                    doc.append(headers[i], values[i])
                } catch (e: Exception) {
                    e.printStackTrace()
                }
            }
            println(
                    "Inserting doc: " + doc.getString("Họ đệm") + " " + doc.getString("Tên") + " " + doc.getString(
                            "Ngày sinh"
                    )
            )
            collection.insertOneUnique(doc)
        }
    }

}

