fun MongoCollection<Document>.random(doc: Document?): Document? {
    var count = this.countDocuments(doc)
    val nextInt = kotlin.random.Random.nextInt(0, count.toInt())
    return this.find(doc).skip(nextInt).first()
}
fun MongoCollection<Document>.random(doc: Bson?): Document? {
    var count = this.countDocuments(doc)
    val nextInt = kotlin.random.Random.nextInt(0, count.toInt())
    return this.find(doc).skip(nextInt).first()
}


fun MongoCollection<Document>.insertOneUnique(insertData: Document, findData: Document? = null) {
    var _findData = findData
    if (_findData == null) {
        _findData = insertData
        _findData.remove("_id")
    }
    if (insertData.isEmpty()) return
    try {
        val count = this.countDocuments(_findData)
        if (count == 0L) {
            this.insertOne(insertData)
        }
    } catch (e: Exception) {
        e.printStackTrace()
    }
}

fun MongoCollection<Document>.removeDuplicate(doc: Document) {
    val iterator = this.find(doc).skip(1).iterator()
    while (iterator.hasNext()) {
        iterator.tryNext()?.let {
            this.deleteOne(it)
        }
    }
}
